import React from "react";
import { CheckoutContextProvider } from "../../context/checkoutcontext/CheckoutContext";
import { CheckOutFlow } from "../checkoutflow/CheckOutFlow";
import { PersonalDataEditor } from "../personaldata";
import { ProductOffers } from "../../pages/onboarding/offer/ProductOffers";
import { CheckoutSummary } from "../../pages/onboarding/summary/CheckoutSummary";
import { Payment } from "../../components/paymentformcard/Payment";


interface Props {
}



export const Onboarding: React.FC<Props> = (Props) => {


   return (
        <CheckoutContextProvider>
            <CheckOutFlow >
                <PersonalDataEditor />
                <ProductOffers />
                <Payment />     
                <CheckoutSummary />
            </CheckOutFlow>
        </CheckoutContextProvider>
    )
}
